        Honnef","email":"dominik@honnef.co","date":"2016-03-19T16:24:31Z"},"message":"Merge
        branch ''graph''\n\nThis replaces the old implementation with a graph-constructing\nalgorithm
        that correctly tracks specific \"uses\" relations between\nobjects and types.\n\nThis
        approach allows more fine-grained checks. It allows for finding\nunused identifiers
        that cyclically use each other. More generally, it\nallows for finding unused
